import React from 'react'
import reciclaje from '../images/reciclaje.svg'



function EliminarUsuario() {
    return (
        
        <button className="eliminarUsuario" ><img src={reciclaje} alt="basura" width="15px"/></button>

    )
}

export default EliminarUsuario
